css:
/* i really want this to be global */
.n-btn-games-small
  {
    border: solid 1px #777;
    margin: 15px;
    margin-left: -10px;
    padding: 3px 10px;
    width: 100px;
    border-radius: 0;
  }

  .btn-primary.active, .btn-primary:active, .show>.btn-primary.dropdown-toggle
  {
    background-color: #6e99c9;
    border: solid 1px #000;
    margin: 15px;
    padding: 3px 10px;
    width: 100px;
    border-radius: 0;
  }

  .breadcrumb
  {
    visibility: hidden;
  }

  .btn-success
  {
    width: 212px;
    height: 54px;
    background: url("http://wayback.archive.org/web/20110705152109im_/http://www.roblox.com/images/cssspecific/rbx2/btn_play_54h.png");
    cursor: pointer;
    padding: 0;
    border: 0;
    text-decoration: none;
    margin: 0;
    margin-top: 30px;
    display: inline-block;
  }
